mod dbg;

use std::io::Read;

// default memory size and cell type
const MEM: usize = 30_000;
type TCell = u8;

macro_rules! frick {
    ( $( $code:tt )* ) => {
        {
            // tape setup
            let mut mem: [TCell; MEM] = [0; MEM];
            let mut ptr = 0;

            // expand instructions
            $(
                instr!(mem ptr $code);
            )*

             // return final state of mem / ptr
            (mem, ptr)
        }
    };
}

macro_rules! instr {
    ////// optimizations //////
    // clear loop optimizer
    ($mem:ident $ptr:ident [-]) => {
        // [-]
        $mem[$ptr] = 0;
    };

    ////// standard tokens //////
    ($mem:ident $ptr:ident >) => {
        // >
        $ptr += 1;
    };
    ($mem:ident $ptr:ident <) => {
        // <
        $ptr -= 1;
    };
    ($mem:ident $ptr:ident +) => {
        // +
        $mem[$ptr] = $mem[$ptr].wrapping_add(1);
    };
    ($mem:ident $ptr:ident -) => {
        // -
        $mem[$ptr] = $mem[$ptr].wrapping_sub(1);
    };
    ($mem:ident $ptr:ident .) => {
        // .
        print!("{}", $mem[$ptr] as char);
    };
    ($mem:ident $ptr:ident ,) => {
        // ,
        $mem[$ptr] = std::io::stdin()
        .bytes().next().unwrap().unwrap();
    };
    ($mem:ident $ptr:ident [ $( $body:tt )* ]) => {
        // [ CODE ]
        while $mem[$ptr] > 0 {
            $(
                instr!($mem $ptr $body);
            )*
        }
    };

    ////// extra tokens from rust parser //////
    ($mem:ident $ptr:ident >>) => {
        $ptr += 2;
    };
    ($mem:ident $ptr:ident <<) => {
        $ptr -= 2;
    };
    ($mem:ident $ptr:ident ..) => {
        let c = $mem[$ptr] as char;
        print!("{}{}", c, c);
    };
    ($mem:ident $ptr:ident ...) => {
        let c = $mem[$ptr] as char;
        print!("{}{}{}", c, c, c);
    };
    ($mem:ident $ptr:ident ->) => {
        instr!($mem $ptr -);
        instr!($mem $ptr >);
    };
    ($mem:ident $ptr:ident <-) => {
        instr!($mem $ptr <);
        instr!($mem $ptr -);
    };
}

